INSERT INTO `services` VALUES (1,'House Cleaning','house-cleaning','Professional residential cleaning services that keep your home spotless and hygienic.','<p>Our comprehensive house cleaning services are designed to maintain your home in pristine condition. We provide thorough cleaning of all living spaces including bedrooms, bathrooms, kitchens, and common areas.</p><p>Our trained professionals use eco-friendly products and follow systematic cleaning protocols to ensure every corner of your home receives proper attention. From deep cleaning to regular maintenance, we customize our services to meet your specific needs.</p>','[\"Thorough dusting and vacuuming\", \"Kitchen and bathroom sanitization\", \"Floor cleaning and mopping\", \"Trash removal\", \"Customizable cleaning schedules\"]','services/icon-1.png',NULL,'services/breadcrumbs/01K1Z245HKVY6HZNDN0PADB3HJ.webp','House Cleaning & Maid Service | Same Day Service Option | HSS','House Cleaning from $168. Weekly, Bi-Weekly & One-Time Deep Cleans. Eco-Friendly, Background-Checked Cleaners. Same-Day Service. Call to Get Started!\n','index, follow','[{\"@context\":\"https:\\/\\/schema.org\",\"@type\":\"Service\",\"@id\":\"https:\\/\\/hexagonservicesolutions.com\\/services\\/house-cleaning#service\",\"name\":\"House Cleaning\",\"alternateName\":\"Residential House & Apartment Cleaning Services\",\"description\":\"Professional house and apartment cleaning services including standard cleaning, deep cleaning, move-in\\/out cleaning, and same-day services. Our background-checked and insured team uses eco-friendly products safe for families and pets.\",\"url\":\"https:\\/\\/hexagonservicesolutions.com\\/services\\/house-cleaning\",\"provider\":{\"@type\":\"LocalBusiness\",\"@id\":\"https:\\/\\/hexagonservicesolutions.com\\/#localbusiness\",\"name\":\"Hexagon Service Solutions\"},\"areaServed\":[{\"@type\":\"State\",\"name\":\"Texas\"}],\"serviceType\":\"House Cleaning Service\",\"category\":\"Home Services\",\"hasOfferCatalog\":{\"@type\":\"OfferCatalog\",\"name\":\"House Cleaning Packages\",\"itemListElement\":[{\"@type\":\"Offer\",\"name\":\"Standard Clean\",\"description\":\"Perfect for regular maintenance. Includes dusting all surfaces, vacuuming carpets & rugs, mopping hard floors, kitchen surface cleaning, bathroom cleaning, and trash removal.\",\"priceSpecification\":{\"@type\":\"PriceSpecification\",\"price\":\"168\",\"priceCurrency\":\"USD\"},\"itemOffered\":{\"@type\":\"Service\",\"name\":\"Standard House Cleaning\",\"serviceOutput\":[\"Dusting all surfaces\",\"Vacuuming carpets & rugs\",\"Mopping hard floors\",\"Kitchen surface cleaning\",\"Bathroom cleaning\",\"Trash removal\"]}},{\"@type\":\"Offer\",\"name\":\"Deep Clean\",\"description\":\"Recommended quarterly. Includes everything in Standard Clean plus baseboards & trim, light fixtures & fans, inside appliances, window sills & blinds, and door frames & switches.\",\"priceSpecification\":{\"@type\":\"PriceSpecification\",\"price\":\"224\",\"priceCurrency\":\"USD\"},\"itemOffered\":{\"@type\":\"Service\",\"name\":\"Deep House Cleaning\",\"serviceOutput\":[\"Everything in Standard Clean\",\"Baseboards & trim\",\"Light fixtures & fans\",\"Inside appliances\",\"Window sills & blinds\",\"Door frames & switches\"]}},{\"@type\":\"Offer\",\"name\":\"Move In\\/Out Clean\",\"description\":\"For empty homes. Includes everything in Deep Clean plus inside cabinets & drawers, oven deep cleaning, refrigerator cleaning, garage sweeping, and patio\\/balcony cleaning.\",\"priceSpecification\":{\"@type\":\"PriceSpecification\",\"price\":\"350\",\"priceCurrency\":\"USD\"},\"itemOffered\":{\"@type\":\"Service\",\"name\":\"Move In\\/Out Cleaning\",\"serviceOutput\":[\"Everything in Deep Clean\",\"Inside cabinets & drawers\",\"Oven deep cleaning\",\"Refrigerator cleaning\",\"Garage sweeping\",\"Patio\\/balcony cleaning\"]}}]},\"additionalType\":[\"Apartment Cleaning\",\"Deep Cleaning\",\"Move-Out Cleaning\",\"Maid Services\",\"Party Clean-Up\",\"Same-Day Services\"],\"availableChannel\":{\"@type\":\"ServiceChannel\",\"availableLanguage\":\"English\",\"serviceLocation\":{\"@type\":\"Place\",\"name\":\"Customer\'s Home\"}},\"additionalProperty\":[{\"@type\":\"PropertyValue\",\"name\":\"Staff Screening\",\"value\":\"Background-checked and insured cleaners\"},{\"@type\":\"PropertyValue\",\"name\":\"Products\",\"value\":\"Eco-friendly cleaning products available\"},{\"@type\":\"PropertyValue\",\"name\":\"Guarantee\",\"value\":\"100% satisfaction guarantee\"},{\"@type\":\"PropertyValue\",\"name\":\"Scheduling\",\"value\":\"Flexible scheduling to fit your lifestyle\"},{\"@type\":\"PropertyValue\",\"name\":\"Consistency\",\"value\":\"Same cleaner for consistency when possible\"},{\"@type\":\"PropertyValue\",\"name\":\"Equipment\",\"value\":\"All equipment and supplies provided\"},{\"@type\":\"PropertyValue\",\"name\":\"Frequency Options\",\"value\":\"Weekly, bi-weekly, monthly, or one-time service\"},{\"@type\":\"PropertyValue\",\"name\":\"Same-Day Service\",\"value\":\"Available upon request\"}],\"termsOfService\":\"https:\\/\\/hexagonservicesolutions.com\\/terms-of-service\",\"hoursAvailable\":[{\"@type\":\"OpeningHoursSpecification\",\"dayOfWeek\":[\"Monday\",\"Tuesday\",\"Wednesday\",\"Thursday\",\"Friday\"],\"opens\":\"09:00\",\"closes\":\"18:30\"},{\"@type\":\"OpeningHoursSpecification\",\"dayOfWeek\":\"Saturday\",\"opens\":\"09:00\",\"closes\":\"12:00\"}]},{\"@context\":\"https:\\/\\/schema.org\",\"@type\":\"FAQPage\",\"@id\":\"https:\\/\\/hexagonservicesolutions.com\\/services\\/house-cleaning#faqs\",\"mainEntity\":[{\"@type\":\"Question\",\"name\":\"How often should I schedule house cleaning services?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"The frequency depends on your lifestyle and needs. Most clients prefer weekly or bi-weekly cleanings for regular maintenance. Busy households with children or pets often benefit from weekly service, while smaller households may find bi-weekly or monthly cleaning sufficient. We also offer one-time deep cleans for special occasions.\"}},{\"@type\":\"Question\",\"name\":\"Do I need to be home during the cleaning?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"No, you don\'t need to be home. Many of our clients provide us with a key or access code. All our cleaners are thoroughly background-checked, bonded, and insured for your peace of mind. We\'ll work with you to establish a secure entry method that you\'re comfortable with.\"}},{\"@type\":\"Question\",\"name\":\"What cleaning products do you use?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"We use professional-grade, EPA-approved cleaning products that are effective yet safe for your family and pets. We also offer eco-friendly, green cleaning options upon request. If you have specific products you\'d prefer us to use or avoid due to allergies or sensitivities, just let us know.\"}},{\"@type\":\"Question\",\"name\":\"What\'s included in a standard cleaning vs. deep cleaning?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Standard cleaning covers all the essentials: dusting, vacuuming, mopping, kitchen and bathroom cleaning, and trash removal. Deep cleaning includes everything in standard cleaning plus detailed work like baseboards, light fixtures, inside appliances, window sills, and hard-to-reach areas. Deep cleaning is recommended quarterly or for first-time service.\"}},{\"@type\":\"Question\",\"name\":\"How do you determine pricing?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Our pricing is based on several factors including the size of your home, number of bedrooms and bathrooms, the type of cleaning service (standard, deep, or move-in\\/out), and frequency of service. We offer free in-home estimates to provide accurate pricing. Regular customers also receive discounted rates.\"}},{\"@type\":\"Question\",\"name\":\"What if I\'m not satisfied with the cleaning?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Your satisfaction is our top priority. We offer a 100% satisfaction guarantee. If you\'re not completely happy with any aspect of our service, contact us within 24 hours and we\'ll return to re-clean the area at no additional charge. We\'re committed to exceeding your expectations.\"}},{\"@type\":\"Question\",\"name\":\"Do you bring your own equipment and supplies?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Yes, our cleaning teams arrive fully equipped with all necessary supplies and equipment, including vacuums, mops, cleaning solutions, and microfiber cloths. However, if you have specific products or equipment you\'d prefer us to use, we\'re happy to accommodate your preferences.\"}},{\"@type\":\"Question\",\"name\":\"Can I customize my cleaning service?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Absolutely! We understand every home and family has unique needs. You can customize your service by adding specific tasks, focusing on certain areas, or excluding rooms you prefer to handle yourself. Just discuss your preferences with us, and we\'ll create a personalized cleaning plan that works for you.\"}}]}]','/services/house-cleaning',1,1,1,NULL,'2025-08-06 03:42:46','2025-08-06 06:46:59'),(2,'Commercial Cleaning','commercial-cleaning','Specialized cleaning services for offices, retail stores, and commercial buildings.','<p>Professional commercial cleaning services designed to maintain clean, healthy work environments that boost productivity and create positive impressions on clients and employees.</p><p>We understand the unique requirements of different commercial spaces and provide customized cleaning solutions for offices, retail stores, medical facilities, and industrial buildings.</p>','[\"Office cleaning and sanitization\", \"Floor maintenance and polishing\", \"Window and glass cleaning\", \"Restroom deep cleaning\", \"Flexible scheduling options\"]','services/icon-2.png',NULL,NULL,'Commercial Cleaning Services | HSS','Professional commercial cleaning for offices, retail, and industrial spaces. Reliable and thorough.','index, follow',NULL,'/services/commercial-cleaning',1,0,2,NULL,'2025-08-06 03:42:46','2025-08-06 06:49:55'),(4,'Deep Cleaning','deep-cleaning','Comprehensive deep cleaning services for thorough property maintenance.','<p>Our deep cleaning services go beyond regular maintenance to address areas that require special attention. Perfect for move-ins, post-construction cleanup, or seasonal deep cleans.</p><p>We focus on hard-to-reach areas, detailed scrubbing, and comprehensive sanitization.</p>','[\"Detailed appliance cleaning\", \"Baseboard and trim cleaning\", \"Light fixture cleaning\", \"Cabinet interior cleaning\", \"Comprehensive sanitization\"]','services/icon-4.png',NULL,NULL,'Deep Cleaning Services | HSS','Comprehensive deep cleaning for move-ins, post-construction, and seasonal maintenance.','index, follow',NULL,'/services/deep-cleaning',1,0,4,NULL,'2025-08-06 03:42:46','2025-08-06 06:50:08'),(7,'Pool Cleaning','pool-cleaning','Professional pool maintenance and cleaning services to keep your pool sparkling clean.','<p>Our comprehensive pool cleaning services ensure your pool remains clean, safe, and inviting throughout the year. We provide regular maintenance, chemical balancing, and equipment inspections.</p><p>From weekly cleanings to seasonal openings and closings, we handle all aspects of pool care.</p>','[\"Weekly pool maintenance\", \"Chemical testing and balancing\", \"Filter cleaning and maintenance\", \"Algae prevention and removal\", \"Equipment inspection and repair\"]','services/icon-7.png',NULL,'services/breadcrumbs/01K1Z2G9F74XHE3E7ATQSRT1VA.webp','Pool Cleaning & Maintenance | Bi-Weekly Service $150| HSS','DFW Pool Cleaning & Maintenance from $150. All Chemicals Included, Crystal Clear Guarantee. Expert Techs, No Contracts. First month 50% off. Let\'s Get Started!\n','index, follow','[{\"@context\":\"https:\\/\\/schema.org\",\"@type\":\"Service\",\"@id\":\"https:\\/\\/hexagonservicesolutions.com\\/services\\/pool-cleaning#service\",\"name\":\"Pool Cleaning\",\"alternateName\":\"Bi-Weekly Pool Maintenance Plan\",\"description\":\"Professional bi-weekly pool maintenance service designed for busy pool owners. Comprehensive water chemistry management, physical cleaning, equipment inspection, and professional monitoring. All chemicals included with Crystal Clear Guarantee.\",\"url\":\"https:\\/\\/hexagonservicesolutions.com\\/services\\/pool-cleaning\",\"provider\":{\"@type\":\"LocalBusiness\",\"@id\":\"https:\\/\\/hexagonservicesolutions.com\\/#localbusiness\",\"name\":\"Hexagon Service Solutions\"},\"areaServed\":[{\"@type\":\"State\",\"name\":\"Texas\"}],\"serviceType\":\"Pool Maintenance Service\",\"category\":\"Pool Services\",\"hasOfferCatalog\":{\"@type\":\"OfferCatalog\",\"name\":\"Pool Service Packages\",\"itemListElement\":[{\"@type\":\"Offer\",\"name\":\"Standard Pool Service\",\"description\":\"Perfect for pools up to 15,000 gallons. Includes bi-weekly service, all chemicals, 10-point water testing, equipment inspection, and Crystal Clear Guarantee.\",\"priceSpecification\":{\"@type\":\"UnitPriceSpecification\",\"price\":\"150\",\"priceCurrency\":\"USD\",\"unitCode\":\"MON\",\"unitText\":\"per month\"},\"itemOffered\":{\"@type\":\"Service\",\"name\":\"Standard Pool Maintenance\",\"serviceOutput\":[\"Up to 15,000 gallons\",\"Bi-weekly service\",\"All chemicals included\",\"10-point water testing\",\"Equipment inspection\",\"Crystal Clear Guarantee\"]},\"additionalProperty\":{\"@type\":\"PropertyValue\",\"name\":\"Annual Savings\",\"value\":\"$300\\/year with annual plan\"}},{\"@type\":\"Offer\",\"name\":\"Medium Pool Service\",\"description\":\"For pools 15,001-25,000 gallons. Everything in Standard plus priority scheduling, seasonal adjustments, free filter cleaning, and digital service reports.\",\"priceSpecification\":{\"@type\":\"UnitPriceSpecification\",\"price\":\"145\",\"priceCurrency\":\"USD\",\"unitCode\":\"MON\",\"unitText\":\"per month\"},\"itemOffered\":{\"@type\":\"Service\",\"name\":\"Medium Pool Maintenance\",\"serviceOutput\":[\"15,001-25,000 gallons\",\"Everything in Standard\",\"Priority scheduling\",\"Seasonal adjustments\",\"Free filter cleaning\",\"Digital service reports\"]},\"additionalProperty\":{\"@type\":\"PropertyValue\",\"name\":\"Annual Savings\",\"value\":\"$340\\/year with annual plan\"}},{\"@type\":\"Offer\",\"name\":\"Large Pool Service\",\"description\":\"For pools 25,001+ gallons. Everything in Medium plus emergency support, consistent technician, equipment protection, and customer portal access.\",\"priceSpecification\":{\"@type\":\"UnitPriceSpecification\",\"price\":\"165\",\"priceCurrency\":\"USD\",\"unitCode\":\"MON\",\"unitText\":\"per month\"},\"itemOffered\":{\"@type\":\"Service\",\"name\":\"Large Pool Maintenance\",\"serviceOutput\":[\"25,001+ gallons\",\"Everything in Medium\",\"Emergency support\",\"Consistent technician\",\"Equipment protection\",\"Customer portal access\"]},\"additionalProperty\":{\"@type\":\"PropertyValue\",\"name\":\"Annual Savings\",\"value\":\"$380\\/year with annual plan\"}}]},\"availableChannel\":{\"@type\":\"ServiceChannel\",\"availableLanguage\":\"English\",\"serviceLocation\":{\"@type\":\"Place\",\"name\":\"Customer\'s Pool Location\"}},\"serviceOutput\":[\"Water Chemistry & Chemical Management\",\"Physical Cleaning & Maintenance\",\"Equipment Inspection & Care\",\"Professional Monitoring\",\"Digital Service Reports\"],\"additionalProperty\":[{\"@type\":\"PropertyValue\",\"name\":\"Service Frequency\",\"value\":\"Bi-weekly maintenance plan\"},{\"@type\":\"PropertyValue\",\"name\":\"Chemicals\",\"value\":\"All chemicals included - no hidden fees\"},{\"@type\":\"PropertyValue\",\"name\":\"Guarantee\",\"value\":\"Crystal Clear Guarantee\"},{\"@type\":\"PropertyValue\",\"name\":\"Staff\",\"value\":\"Licensed and insured pool professionals\"},{\"@type\":\"PropertyValue\",\"name\":\"Reports\",\"value\":\"Digital service reports with photos\"},{\"@type\":\"PropertyValue\",\"name\":\"Business Type\",\"value\":\"Local family-owned business serving DFW\"},{\"@type\":\"PropertyValue\",\"name\":\"Pool Types\",\"value\":\"Traditional chlorine and saltwater pools\"},{\"@type\":\"PropertyValue\",\"name\":\"Emergency Support\",\"value\":\"24-hour response for urgent issues\"},{\"@type\":\"PropertyValue\",\"name\":\"Annual Benefits\",\"value\":\"15% savings, no price increases, free filter cleaning\"}],\"termsOfService\":\"https:\\/\\/hexagonservicesolutions.com\\/terms-of-service\",\"hoursAvailable\":[{\"@type\":\"OpeningHoursSpecification\",\"dayOfWeek\":[\"Monday\",\"Tuesday\",\"Wednesday\",\"Thursday\",\"Friday\"],\"opens\":\"09:00\",\"closes\":\"18:30\"},{\"@type\":\"OpeningHoursSpecification\",\"dayOfWeek\":\"Saturday\",\"opens\":\"09:00\",\"closes\":\"12:00\"}],\"potentialAction\":{\"@type\":\"ConsumeAction\",\"target\":{\"@type\":\"EntryPoint\",\"urlTemplate\":\"https:\\/\\/hexagonservicesolutions.com\\/contact?service=pool-cleaning\",\"actionPlatform\":[\"http:\\/\\/schema.org\\/DesktopWebPlatform\",\"http:\\/\\/schema.org\\/MobileWebPlatform\"]},\"name\":\"Get Free Pool Assessment\"}},{\"@context\":\"https:\\/\\/schema.org\",\"@type\":\"FAQPage\",\"@id\":\"https:\\/\\/hexagonservicesolutions.com\\/services\\/pool-cleaning#faqs\",\"mainEntity\":[{\"@type\":\"Question\",\"name\":\"Is Bi-weekly service enough for my pool?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"For most residential pools with proper circulation and filtration, bi-weekly professional service combined with basic owner maintenance (skimming, water level) works excellently. We\'ll assess your pool during the free consultation to ensure bi-weekly service meets your needs.\"}},{\"@type\":\"Question\",\"name\":\"What if my pool has problems between visits?\",\"acceptedAnswer\":{\"@type\":\"Answer\",\"text\":\"Our Crystal Clear Guarantee means we\'ll return within 24 hours if there are any issues. Emergency support is 